import React, { Component } from 'react';
import './styles.css';
import axios from 'axios';

export default class Create extends Component {
  constructor (props){
    super(props);
    this.onChangePersonName = this.onChangePersonName.bind(this);
    this.onChangePersonCpf = this.onChangePersonCpf.bind(this);
    this.onSubmit = this.onSubmit.bind(this);

    this.state = {
      person_name:'',
      person_cpf:'',
    };
  };

  onChangePersonName(e){
    this.setState({
      person_name: e.target.value
    });
  }

  onChangePersonCpf(e){
    this.setState({
      person_cpf: e.target.value
    });
  }

  onSubmit(e){
    e.preventDefault();
    console.log(`Os valores s√£o: ${this.state.person_name} e ${this.state.person_cpf}`);
    this.setState({
      person_name:'',
      person_cpf:''
    })
  }





  render() {
    return (
      <div className='create-person'>
        <h3>Adicione uma nova pessoa</h3>
        <form>
          <div className="form-group">
            <label>Adicionar Nome*: </label>
            <input type="text" className="form-control"/>
          </div>
          <div className="form-group">
            <label>Adicionar Cpf*: </label>
            <input type="number" className="form-control"/>
          </div>
          <div className="form-goup">
            <input type="submit" value="Registrar Pessoa" className="btn btn-primary"/>
          </div>
        </form>
      </div>
    );
  }
}
